import store from "@/scripts/store";
export default {
  name: 'App',
  components: {
    Footer,
    Header
  },
  setup() {
    const check = () => {
      axios.get("/api/account/check").then(({
        data
      }) => {
        console.log(data);
        if (data) {
          store.commit("setAccount", data);
        } else {
          store.commit("setAccount", 0);
        }
      });
    };
    const id = sessionStorage.getItem("id");
    if (id) {
      store.commit("setAccount", id);
    }
  }
};
